[Form]
public class WHSPackingStructure extends FormRun
{
    WHSLoadTable                whsLoadTable;
    QueryBuildRange             qbrLicensePlateId;
    QueryBuildDataSource        flexiQbd;
    WHSUOMStructure             curUOMStructure;
    WHSLicensePlateId           caseId;

    WHSPackingStructureForm     whsPackingStructureForm;
    InventDimCtrl_Frm_WHS       inventDimFormSetup;

}

public void init()
{
    whsPackingStructureForm = new WHSPackingStructureForm();

    if (element.args().dataset() != tableNum(WHSLoadTable))
    {
        throw error("@WAX1918");
    }

    whsLoadTable = element.args().record();

    if (whsLoadTable.LoadDirection != WHSLoadDirection::Inbound)
    {
        throw error("@WAX1919");
    }

    super();

    whsLoadId.text(whsLoadTable.LoadId);

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

public InventDimCtrl_Frm_WHS inventDimSetupObject()
{
    return inventDimFormSetup;
}

private void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_WHS::newFromForm(element);

                InventDimParm inventDimParmLocal;
                inventDimParmLocal.setActiveSiteAndWarehouseDimensions();
                inventDimParmLocal.setAllProductDimensions();
                inventDimParmLocal.setAllTrackingDimensions();
                inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmLocal);
            }
            this.updateCreatedWorkIdAndQuantityDesign();
            break;

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(whsasnitem.ItemId));
            inventDimFormSetup.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

private void updateCreatedWorkIdAndQuantityDesign()
{
    boolean useCreatedReceiptWorkId = true;

    WHSUOMStructure_Cases_CreatedWorkId.visible(!useCreatedReceiptWorkId);
    WHSUOMStructure_Pallets_CreatedWorkId.visible(!useCreatedReceiptWorkId);
    WHSASNItem_WorkCreatedQty.visible(!useCreatedReceiptWorkId);

    WHSUOMStructure_Cases_CreatedReceiptWorkId.visible(useCreatedReceiptWorkId);
    WHSUOMStructure_Pallets_CreatedReceiptWorkId.visible(useCreatedReceiptWorkId);
    WHSASNItem_ReceiptWorkCreatedQty.visible(useCreatedReceiptWorkId);
}

public int active()
{
    int ret;

    ret = super();

    flexiQbd.rangeField(fieldNum(WHSUOMStructure, LicensePlateId)).value(WHSUOMStructure_Pallets.LicensePlateId);
    flexiQbd.rangeField(fieldNum(WHSUOMStructure, ShipmentId)).value(WHSUOMStructure_Pallets.ShipmentId);
    flexiQbd.rangeField(fieldNum(WHSUOMStructure, Module)).value(queryValue(WHSUOMStructure_Pallets.Module));
    whsuomStructure_Flexi_ds.executeQuery();

    return ret;
}

public void create(boolean _append = false)
{
    whsPackingStructureForm.whsUOMStructurePallets_create(whsLoadTable, this);
    whsuomStructure_Flexi_ds.executeQuery();
}

public void delete()
{
    super();

    whsuomStructure_Flexi_ds.executeQuery();
}

public void init()
{
    QueryBuildRange qbr;

    super();

    qbr = whsuomStructure_Pallets_q.dataSourceName(formDataSourceStr(WHSPackingStructure, WHSUOMStructure_Pallets)).addRange(fieldNum(WHSUOMStructure, LicensePlateParent));
    qbr.value(SysQuery::valueEmptyString());
    qbr.status(RangeStatus::Hidden);

    this.cacheAddMethod(tableMethodStr(WHSUOMStructure, displayCreatedReceiptWorkId));
}

public void linkActive()
{
    WHSUOMStructure localStructure;

    localStructure = WHSUOMStructure::find(whsuomStructure_Cases.LicensePlateId, WHSModule::Purch, whsuomStructure_Cases.ShipmentId);

    super();

    if (localStructure)
    {
        whsuomStructure_Cases_ds.positionToRecord(localStructure);
    }
}

public void delete()
{
    curUOMStructure = WHSUOMStructure::find(whsuomStructure_Cases.LicensePlateParent, WHSModule::Purch, whsuomStructure_Cases.ShipmentId, true);

    super();

    whsPackingStructureForm.updateUOMStructure(curUOMStructure);

    whsuomStructure_Pallets_ds.research(true);
    whsuomStructure_Flexi_ds.executeQuery();
}

public void init()
{
    QueryBuildRange qbr;

    super();

    qbr = whsuomStructure_Cases_q.dataSourceName(formDataSourceStr(WHSPackingStructure, WHSUOMStructure_Cases)).addRange(fieldNum(WHSUOMStructure, LicensePlateParent));
    qbr.value(SysQuery::valueNotEmptyString());
    qbr.status(RangeStatus::Hidden);

    this.cacheAddMethod(tableMethodStr(WHSUOMStructure, displayCreatedReceiptWorkId));
}

