public void write()
{
    curUOMStructure = WHSUOMStructure::find(whsuomStructure_Flexi.LicensePlateId, whsuomStructure_Flexi.Module, whsuomStructure_Flexi.ShipmentId, true);
    whsASNItem.InventDimId = InventDim::findOrCreate(inventDim).InventDimId;

    super();

    whsPackingStructureForm.updateUOMStructure(curUOMStructure);
    this.setInvendDimId();

    whsuomStructure_Pallets_ds.research(true);
    whsuomStructure_Flexi_ds.executeQuery();
}

public void delete()
{
    curUOMStructure = WHSUOMStructure::find(whsuomStructure_Flexi.LicensePlateId, whsuomStructure_Flexi.Module, whsuomStructure_Flexi.ShipmentId, true);

    super();

    whsPackingStructureForm.updateUOMStructure(curUOMStructure);

    whsuomStructure_Pallets_ds.research(true);
    whsuomStructure_Flexi_ds.executeQuery();
}

private void setInvendDimId()
{
    if (whsASNItem.InventDimId != inventDim.InventDimId)
    {
        inventDim.data(InventDim::find(whsASNItem.InventDimId));
        inventDim_ds.setCurrent();
    }
}

public void create(boolean _append = false)
{
    whsPackingStructureForm.whsAsnItem_create(whsuomStructure_Pallets,
                                              whsuomStructure_Cases,
                                              curUOMStructure,
                                              whsuomStructure_Flexi,
                                              element);

    whsuomStructure_Flexi_ds.executeQuery();
    whsASNItem_ds.research(true);
}

public int active()
{
    int ret;

    ret = super();

    element.updateDesign(InventDimFormDesignUpdate::Active);

    return ret;
}

